"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Diffuse large B-cell lymphoma (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/diffuse-large-b-cell-lymphoma-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H5606333\">",
"      <span class=\"h1\">",
"       What is diffuse large B-cell lymphoma?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Diffuse large B-cell lymphoma, called &ldquo;DLBCL,&rdquo; is one type of lymphoma. Lymphoma is a cancer of the lymphatic system. The lymphatic system is made up of organs all over the body that make and store cells that fight infection (",
"      <a class=\"graphic graphic_figure graphicRef63854 \" href=\"UTD.htm?25/6/25702\">",
"       figure 1",
"      </a>",
"      ). These infection-fighting cells are also called &ldquo;white blood cells.&rdquo;",
"     </p>",
"     <p>",
"      When people have DLBCL, their white blood cells become abnormal and grow out of control. These cells can travel to different parts of the body. Often, the abnormal cells collect in bean-shaped organs called lymph nodes. This causes the lymph nodes to swell.",
"     </p>",
"     <p>",
"      DLBCL is a common type of lymphoma and usually happens in older people. It grows quickly, so it needs to be treated quickly.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5606340\">",
"      <span class=\"h1\">",
"       What are the symptoms of DLBCL?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with DLBCL first notice 1 or more swollen lymph nodes. These swollen nodes are often in the neck, groin, or belly. You may be able to feel them under the skin but they are usually not painful. People with DLBCL can also have:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Weight loss",
"       </li>",
"       <li>",
"        Night sweats that soak their clothes",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5606347\">",
"      <span class=\"h1\">",
"       Is there a test for DLBCL?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will talk with you and do an exam. He or she will also do:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        A lymph node biopsy &mdash; A doctor will remove one of the swollen lymph nodes. Then another doctor will look at the cells under a microscope to see if cancer cells are present.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5606354\">",
"      <span class=\"h1\">",
"       What is lymphoma staging?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Lymphoma staging is a way in which doctors find out how far the lymphoma has spread in the lymphatic system or in the body. The right treatment for you depends a lot on the stage of your lymphoma.",
"     </p>",
"     <p>",
"      To find out how far your DLBCL has spread, your doctor will do an exam, blood tests, and an imaging test, such as a CT or PET scan. Imaging tests create pictures of the inside of the body.",
"     </p>",
"     <p>",
"      Your doctor might also do a bone marrow biopsy. For this test, a doctor will take a small sample of bone marrow (the tissue in the middle of your bones). Another doctor will look at the sample under a microscope to see if it has cancer.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5606361\">",
"      <span class=\"h1\">",
"       How is DLBCL treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with DLBCL are usually treated with:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Chemotherapy &mdash; Chemotherapy is the term doctors use to describe a group of medicines that kill cancer cells.",
"       </li>",
"       <li>",
"        Medicines called &ldquo;immunotherapy&rdquo; &mdash; These medicines kill cancer cells by recognizing the cancer cells.",
"       </li>",
"       <li>",
"        Radiation therapy &mdash; Radiation kills cancer cells.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      All people with DLBCL get chemotherapy and immunotherapy. Some people will also get radiation therapy.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5606368\">",
"      <span class=\"h1\">",
"       What happens after treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After treatment, your doctor will check to see if your DLBCL is gone. He or she will talk with you and do an exam, blood tests, and an imaging test. He or she might also do another bone marrow biopsy.",
"     </p>",
"     <p>",
"      If your doctor does not see cancer in your blood or body, then he or she will check every so often to see if the DLBCL has come back. Regular follow-ups will include talking with your doctor and having exams. Sometimes, your doctor will also do blood tests and imaging tests.",
"     </p>",
"     <p>",
"      You should also watch for the symptoms listed above, such as swollen lymph nodes, fever, weight loss, or night sweats. Tell your doctor or nurse if you have those symptoms, because having those symptoms could mean that the cancer has come back.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5606375\">",
"      <span class=\"h1\">",
"       What happens if the DLBCL comes back?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If the DLBCL comes back, or if it never went away after treatment, you might have more chemotherapy, immunotherapy, or a bone marrow transplant. A bone marrow transplant is a treatment that replaces cells in the bone marrow that are killed by chemotherapy or radiation.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5606382\">",
"      <span class=\"h1\">",
"       What else should I do?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It&rsquo;s important to follow all your doctor&rsquo;s instructions about visits and tests. It&rsquo;s also important to talk to your doctor about any side effects or problems you have during treatment.",
"     </p>",
"     <p>",
"      Getting treated for DLBCL involves making many choices, such as what treatment to have and when.",
"     </p>",
"     <p>",
"      Always let your doctors and nurses know how you feel about a treatment. Any time you are offered a treatment, ask:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        What are the benefits of this treatment? Is it likely to help me live longer? Will it reduce or prevent symptoms?",
"       </li>",
"       <li>",
"        What are the downsides to this treatment?",
"       </li>",
"       <li>",
"        Are there other options besides this treatment?",
"       </li>",
"       <li>",
"        What happens if I do not have this treatment?",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5606389\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
