"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?16/36/16969?source=related_link\">",
"      Initial approach to low-risk clinically localized prostate cancer",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?23/52/24394?source=related_link\">",
"      Interpretation of prostate biopsy",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?40/2/41001?source=related_link\">",
"      Measurement of prostate specific antigen",
"     </a>",
"    </li>",
