var title_f26_19_26940="Clinical and molecular features of HES variants";
var content_f26_19_26940=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F59869&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F59869&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Features of hypereosinophilic syndrome variants",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Terminology for HES variants",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical features",
"       </td>",
"       <td class=\"subtitle1\">",
"        Subtypes/identified abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T cell lymphocytic variants (L-HES)",
"       </td>",
"       <td>",
"        <p>",
"         Prominent skin findings (including plaques, erythroderma, urticaria)",
"        </p>",
"        <p>",
"         Polyclonal hypergammaglobulinemia",
"        </p>",
"        <p>",
"         Usually a benign lymphoproliferative disorder, but may progress to T cell lymphoma",
"        </p>",
"       </td>",
"       <td>",
"        Aberrant IL-5 producing T cells",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Myeloproliferative variants",
"       </td>",
"       <td>",
"        <p>",
"         Features of myeloproliferative disorder:",
"        </p>",
"        <p>",
"         &uarr; serum B12",
"        </p>",
"        <p>",
"         Anemia +/or thrombocytopenia",
"        </p>",
"        <p>",
"         Hepato- or splenomegaly",
"        </p>",
"        <p>",
"         Circulating leukocyte precursors",
"        </p>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         May show &uarr; serum tryptase + mast cell abnormalities",
"        </p>",
"        <p>",
"         Occurs almost exclusively in males",
"        </p>",
"       </td>",
"       <td>",
"        Deletion on 4q12 &rarr; F1P1L1-PDGFRalpha fusion",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Familial HES",
"       </td>",
"       <td>",
"        <p>",
"         Asymptomatic eosinophilia from birth, autosomal dominant",
"        </p>",
"        <p>",
"         Progression may occur",
"        </p>",
"       </td>",
"       <td>",
"        Mapped to 5q 31-33",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Undefined HES",
"       </td>",
"       <td>",
"        Marked eosinophilia in the absence of signs/symptoms of end organ involvement",
"       </td>",
"       <td>",
"        Benign",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Multisystem involvement with varied signs/symptoms",
"       </td>",
"       <td>",
"        Complex",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Episodic angioedema and eosinophilia that resolves spontaneously between episodes, episodes often preceeded by rise in serum IL-5, may progress to HES or L-HES",
"       </td>",
"       <td>",
"        Episodic",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Overlap HES",
"       </td>",
"       <td>",
"        Single organ - restricted eosinophilic disease",
"       </td>",
"       <td>",
"        Includes eosinophilic gastrointestinal disease, chronic eosinophilic pneumonia, and others",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Associated HES",
"       </td>",
"       <td>",
"        Marked eosinophilia in the setting of an underlying disorder associated with eosinophilia",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f26_19_26940=[""].join("\n");
