var title_f26_19_26941="Fibromyalgia diagnostic criteria";
var content_f26_19_26941=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F81631&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F81631&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    American College of Rheumatology preliminary diagnostic criteria for fibromyalgia and measurement of symptom severity",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        A patient satisfies diagnostic criteria for fibromyalgia if the following 3 conditions are met:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        1) Widespread pain index (WPI) &ge;7 and symptom severity (SS) scale score &ge;5 or WPI 3-6 and SS scale score &ge;9.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        2) Symptoms have been present at a similar level for at least 3 months.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        3) The patient does not have a disorder that would otherwise explain the pain.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Ascertainment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        1) WPI",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Note the number areas in which the patient has had pain over the last week. In how many areas has the patient had pain? Score will be between 0 and 19.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Neck",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Jaw, left",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Jaw, right",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Shoulder girdle, left",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Shoulder girdle, right",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Upper arm, left",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Upper arm, right",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Lower arm, left",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Lower arm, right",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Chest",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Abdomen",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Upper back",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Lower back",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Hip (buttock, trochanter), left",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Hip (buttock, trochanter), right",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Upper leg, left",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Upper leg, right",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Lower leg, left",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Lower leg, right",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        2) SS scale score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        For the each of the 3 symptoms below, indicate the level of severity over the past week using the following scale:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = no problem",
"       </td>",
"       <td>",
"        1 = slight or mild problems, generally mild or intermittent",
"       </td>",
"       <td>",
"        2 = moderate, considerable problems, often present and/or at a moderate level",
"       </td>",
"       <td>",
"        3 = severe, pervasive, continuous, life-disturbing problems",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"4\">",
"        - Fatigue (0-3)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"4\">",
"        - Waking unrefreshed (0-3)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"4\">",
"        - Cognitive symptoms (0-3)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Considering somatic symptoms in general, indicate whether the patient has:*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"4\">",
"        - No symptoms (0)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"4\">",
"        - Few symptoms (1)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"4\">",
"        - A moderate number of symptoms (2)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"4\">",
"        - A great deal of symptoms (3)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        The SS scale score is the sum of the severity of the 3 symptoms (fatigue, waking unrefreshed, cognitive symptoms) plus the extent (severity) of somatic symptoms in general. The final score is between 0 and 12.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Somatic symptoms that might be considered: muscle pain, irritable bowel syndrome, fatigue/tiredness, thinking or remembering problem, muscle weakness, headache, pain/cramps in the abdomen, numbness/tingling, dizziness, insomnia, depression, constipation, pain in the upper abdomen, nausea, nervousness, chest pain, blurred vision, fever, diarrhea, dry mouth, itching, wheezing, Raynaud's phenomenon, hives/welts, ringing in ears, vomiting, heartburn, oral ulcers, loss of/change in taste, seizures, dry eyes, shortness of breath, loss of appetite, rash, sun sensitivity, hearing difficulties, easy bruising, hair loss, frequent urination, painful urination, and bladder spasms.",
"    </div>",
"    <div class=\"reference\">",
"     Wolfe, F, Clauw, DJ, Fitzcharles, MA, et al. The American College of Rheumatology preliminary diagnostic criteria for fibromyalgia and measurement of symptom severity. Arthritis Care Res 2010; 62:600. Copyright &copy; 2010 American College of Rheumatology. Reproduced with permission of John Wiley &amp; Sons.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
